import React from 'react'
import PropTypes from 'prop-types'
import axios from 'axios'
import 'bulma/css/bulma.css'
import NavbarOther from '../Navbar/NavbarOther'


class City extends React.Component {

    constructor(props) {
        super(props);
        // this.state = {date: new Date()};

    }


    componentDidMount() {
        axios.get(`http://localhost:3000/globeData/${this.props.match.params.id}`).then(res => {
            this.state = res.data
        }).catch(err => alert(err))
    }

    render() {

        return (<a href="https://bulma.io">
            <img src="https://bulma.io/images/made-with-bulma--white.png" alt="Made with Bulma" width="128" height="24" />
        </a>)
    }
}

City.propTypes = {
}


export default City
